// Search.js

/* 

  wip:

  currently: 
    when we get some search results, the results expand the Search div (which has a set background image), and it breaks the design.

  expected:


*/

import React from 'react';
import SearchFormContainer from './SearchForm/SearchFormContainer';
import SearchResultsContainer from './SearchResults/SearchResultsContainer';

const Search = props => {
  return(
    <div className="Search Search--showImage">


      <div className="Search__image"></div>
      <div className="Search__title">
        Find en behandling idag
      </div>
      <div className="Search__formWrapper">
        <SearchFormContainer
          getSearchResults={props.getSearchResults}
        />
      </div>
      <div className="Search__resultsWrapper">
        <SearchResultsContainer
          rawSearchResults={props.rawSearchResults}
          clientCoordinates={props.clientCoordinates}
        />
      </div>
    </div>
  )
}

export default Search;
